actionConfiguration.body:
() => {
  edit_emp_filepicker.files.length > 0 ? update_photo.run(() => {
    update_emp.run(() => {
      fetch_all_emp.run(() => get_emp_by_id.run(() => {
        showAlert("Employee data updated successfully", 'success');
        storeValue('empTab', 2);
      }, () => {}, {
        empId: get_emp_by_id.data[0].id
      }));
    }, () => () => showAlert('please enter the employee details correctly', 'error'), {
      photo: update_photo.data?.signedUrl.split('?')[0]
    });
  }, () => {}, {
    file: edit_emp_filepicker.files[0]
  }) : update_emp.run(() => {
    showAlert("Employee data updated successfully", 'success');
    fetch_all_emp.run(() => get_emp_by_id.run(() => {
      showAlert("Employee data updated successfully", 'success');
      storeValue('empTab', 2);
    }, () => {}, {
      empId: get_emp_by_id.data[0].id
    }));
  }, () => () => showAlert('please enter the employee details correctly', 'error'), {
    photo: get_emp_by_id.data[0].photo
  });
}

